		function checkMerge(particles) {
			for (var i = 0 ; i < particles.length-1 ; ++i) {
				for (var j = i+1 ; j < particles.length ; ++j) {
					if (close(particles[i], particles[j])) {
						var newChance = Math.random();
						if (newChance < 1 - Math.pow(1-mergeCh, 1/fps * gameSpeed)) {
							merge(particles[i], particles[j]);
							i = 0;
							j = 1;
						}
					}
				}
			}
		}
		
		
		
		function close(particleOne, particleTwo) {
			if (lower_eq(distance(particleOne, particleTwo), divide(plus(particleOne.size, particleTwo.size), big(2)))) {
				return true;
			}
			else {
				return false;
			}
		}
		
		
		
		function distance(p1, p2) {
			return pow_func(plus(multiply(minus(p1.posX, p2.posX),minus(p1.posX, p2.posX)), multiply(minus(p1.posY, p2.posY),minus(p1.posY, p2.posY))), 0.5);
		}
		
		
		
		
		
