		this.addEventListener("tick", setAutoTarget.bind(this));
		function setAutoTarget() {
			if (particles.length > 0) {
				if (options.autotarget == 1) {
					currentTarget = particles[0];
				}
				else if (options.autotarget == 2) {
					currentTarget = particles[particles.length - 1];
				}
				else if (options.autotarget == 3) {
					currentTarget = findFastest(particles);
				}
				else if (options.autotarget == 4) {
					currentTarget = findSlowest(particles);
				}
				else if (options.autotarget == 5) {
					currentTarget = findStrongest(particles);
				}
				else if (options.autotarget == 6) {
					currentTarget = findWeakest(particles);
				}
			}
			
		}
		
		
		
		function findFastest(particles) {
			var fastestP = NULL;
			var fastestSpeed = big(0);
			for (var i = 0 ; i < particles.length ; ++i) {
				if (bigger(particles[i].speed, fastestSpeed)) {
					fastestP = particles[i];
					fastestSpeed = particles[i].speed;
				}
			}
			return fastestP;
		}
		
		
		function findSlowest(particles) {
			var slowestP = NULL;
			var slowestSpeed = particles[0].speed;
			for (var i = 1 ; i < particles.length ; ++i) {
				if (lower(particles[i].speed, slowestSpeed)) {
					slowestP = particles[i];
					slowestSpeed = particles[i].speed;
				}
			}
			return slowestP;
		}
		
		function findStrongest(particles) {
			var strongestP = NULL;
			var strongestPow = big(0);
			for (var i = 0 ; i < particles.length ; ++i) {
				if (bigger(particles[i].damage, strongestPow)) {
					strongestP = particles[i];
					strongestPow = particles[i].damage;
				}
			}
			return strongestP;
		}
		
		function findWeakest(particles) {
			var weakestP = NULL;
			var weakestPow = particles[0].damage;
			for (var i = 1 ; i < particles.length ; ++i) {
				if (lower(particles[i].damage, weakestPow)) {
					weakestP = particles[i];
					weakestPow = particles[i].damage;
				}
			}
			return weakestP;
		}
		
		
		
		
		
