		function createDMG(damage, x, y, xChange_v, yChange_v, amount) {
			var splash = new lib.spl();
			splash.visible = false;
			splash.scaleX = 0.7;
			splash.scaleY = 0.7;
			splash.alpha = 1;
			splash.damage = damage;
			splash.xChange = xChange_v * 6;
			splash.yChange = yChange_v * 6;
			splash.splash_damage.text = "- " + short(damage);
			if (amount > 1) {
				splash.splash_damage.text += " x" + short_mini(Math.round(amount));
			}
			splash.x = x;
			splash.y = y;
			splashes++;
			splash.visible = true;
			stage.addChild(splash);
			splash.addEventListener('tick', fly);
			textArray.push(splash);
		}
		
		function createDMGCrit(damage, x, y, xChange_v, yChange_v, amount) {
			var splash = new lib.spl();
			splash.visible = false;
			splash.scaleX = 1.1;
			splash.scaleY = 1.1;
			splash.alpha = 1;
			splash.damage = damage;
			splash.xChange = xChange_v * 6;
			splash.yChange = yChange_v * 6;
			splash.splash_damage.text = "- " + short(damage) + "!";
			if (amount > 1) {
				splash.splash_damage.text += " x" + short_mini(Math.round(amount));
			}
			splash.x = x;
			splash.y = y;
			splashes++;
			splash.visible = true;
			stage.addChild(splash);
			splash.addEventListener('tick', fly);
			textArray.push(splash);
		}
		
		
		function fly(e) {
			var splash = e.currentTarget;
			if (splash.alpha > 0) {
				splash.alpha -= (1 + (splashes/40))/fps * gameSpeed;
				splash.x += splash.xChange*24/fps * gameSpeed;
				splash.y += splash.yChange*24/fps * gameSpeed;
			}
			if (splash.alpha <= 0) {
				splashes--;
				splash.removeEventListener('tick', fly);
				stage.removeChild(splash);
			}
			if (splash.x == 0 && splash.y == 0) {
				splash.visible = false;
			}
			
			setShadow3(splash.splash_damage, options.shadows);
		}
		
		
		
