			removeAll(closestRing);
			closestRing.draw.removeEventListener('tick', ring_set);
			stage.removeChild(closestRing.draw);
			rings_amount--;
			
			closestRing = NULL;
			lastRing = new lRingObj(0, big(5), big(10), big(10));
