		function removeAll(ring) {
			var c_ring = ring
			while (c_ring.next != NULL) {
				c_ring.draw.removeEventListener('tick', ring_set);
				stage.removeChild(c_ring.draw);
				c_ring = c_ring.next;
				c_ring.prev = NULL;
				rings_amount--;
			}
		}
		
		
		
