		function createParticle() {
			var particle = new lib.particle();
			particle.visible = false;
			stage.addChild(particle);
			particle.x = CENTERX;
			particle.y = CENTERY;
			particle.color = Math.ceil(Math.random() * 10);
			particle.frame.gotoAndStop(particle.color);
			particle.posX = big(0);
			particle.posY = big(0);
			particle.movX = -1 + Math.random()*2;
			particle.movY = -1 + Math.random()*2;
			var normator = Math.sqrt(particle.movX*particle.movX + particle.movY*particle.movY);
			particle.movX /= normator;
			particle.movY /= normator;
			particle.rSpeed = new BigNum(0.9 + Math.random()*0.2 , 0);
			particle.speed = multiply(multiply(multiply(multiply(multiply(multiply(particle.rSpeed, b1mult), b5mult), b9mult), totalPrSpeedMult), movMult), dmgSpM);
			particle.maxSpeed = particle.speed;
			particle.baseSpeed = particle.speed;
			particle.friction = friction; // per second
			particle.drag = drag; // per second
			particle.acceleration = multiply(multiply(multiply(multiply(multiply(acc_base, b17mult), totalPrSpeedMult), b21mult), movMult), dmgSpM);
			particle.a_derivative = multiply(multiply(multiply(multiply(multiply(ad_base, totalPrSpeedMult), ad_mult), ad_mult2), movMult), dmgSpM);
			particle.number = particles.length;
			particle.baseAcceleration = particle.acceleration;
			particle.baseA_derivative = particle.a_derivative;
			
			particle.reb = rebirth;
			
			if (bigger(max_s, min_s)) {
				particle.size = plus(multiply(min_s, b23mult), multiply(big(Math.random()),minus(multiply(max_s, b23mult),multiply(min_s, b23mult))));
			}
			else {
				particle.size = plus(multiply(max_s, b23mult), multiply(big(Math.random()),minus(multiply(min_s, b23mult),multiply(max_s, b23mult))));
			}
			
			particle.size = plus(particle.size, multiply(fullDistance, big(sizePrc)));
			
			particle.size = b_min(particle.size, divide(fullDistance, big(5)));
			
			
			particle.sizeMult = pow_func(particle.size, dimensionality); //in meters
			particle.rotator = (-1 + Math.random()*2)*1000;
			
			particle.DMGPerym = multiply(multiply(multiply(multiply(multiply(dmg_ym, b10mult),particle.sizeMult),totalPrDamageMult), dmgSpM), thisWallPow);
			particle.DMGBase = particle.DMGPerym;
			particle.damage = multiply(particle.DMGPerym, particle.speed);
			
			particle.critChance = crit_chance;
			particle.critPower = crit_power;
			particle.lifeSpan = lifespan;
			particle.lifeEst = lifespan;
			particle.limit = false;
			particle.exists = true;
			
			particle.scaleSize = b_max(multiply(divide(new BigNum(FULLSCALE, 0), fullDistance), particle.size), new BigNum(0.035,0));
			particle.scaleX = Math.min(FULLSCALE/5, getVal(particle.scaleSize));
			particle.scaleY = Math.min(FULLSCALE/5, getVal(particle.scaleSize));
			
			particle.hoverage.visible = false;
			particle.distance = big(0);
			
			
			if (currentTarget == NULL) {
				currentTarget = particle;
			}
			
			current++;
			
			particle.addEventListener('tick', move_particle);
			particles.push(particle);
		}
		
		
		function killParticle(particles, num) {
			particles[num].lifeEst = 0;
			if (currentTarget == particles[num]) {
				currentTarget = NULL;
			}
			current--;
			particles[num].exists = false;
			particles[num].removeEventListener('tick', move_particle);
			stage.removeChild(particles[num]);
			particles.splice(num, 1);
			for (var i = num ; i < particles.length ; ++i) {
				particles[i].number--;
			}
		}
		
		
		function killAll(particles) {
			while (particles.length > 0) {
				killParticle(particles, particles.length - 1);
			}
		}
		
		
		
		
		function ring_set(e) {
			var the_ring = e.currentTarget;
			the_ring.x = CENTERX;
			the_ring.y = CENTERY;
			
			setShadow3(the_ring.the_ring, options.shadows);
			
			
			if (the_ring.x == CENTERX && the_ring.y == CENTERY) {
				the_ring.visible = true;
			}
			else {
				the_ring.visible = false;
			}
			
			the_ring.the_ring.scaleX = Math.min(getVal(divide(the_ring.stats.distance, fullDistance)), 1.7) * 2.45;
			the_ring.the_ring.scaleY = Math.min(getVal(divide(the_ring.stats.distance, fullDistance)), 1.7) * 2.45;
			
			if (not_eq(the_ring.stats.fake_hpnow, the_ring.stats.hpnow)) {
				the_ring.stats.fake_hpnow = divide(plus(the_ring.stats.fake_hpnow, multiply(the_ring.stats.hpnow, big(0.1))), big(1.1));
			}
			
			the_ring.the_ring.alpha = 0.5 + 0.5*getVal(divide(the_ring.stats.fake_hpnow , the_ring.stats.hpmax));
			the_ring.the_ring.r_color.gotoAndStop(the_ring.stats.color);
			
			if (options.ringEffects == true) {
				the_ring.the_ring.breakness_next.visible = true;
				the_ring.the_ring.breakness.visible = true;
				the_ring.the_ring.breakness.gotoAndStop(Math.floor(5 - getVal(divide(the_ring.stats.fake_hpnow , the_ring.stats.hpmax))*5));
				the_ring.the_ring.breakness_next.gotoAndStop(the_ring.the_ring.breakness.currentFrame+1, 4);
				the_ring.the_ring.breakness_next.alpha = ((5 - getVal(divide(the_ring.stats.fake_hpnow , the_ring.stats.hpmax))*5) % 1);
				the_ring.the_ring.breakness.alpha = 1;
			}
			else {
				the_ring.the_ring.breakness_next.visible = false;
				the_ring.the_ring.breakness.visible = false;
			}
				
			if (bigger(divide(the_ring.stats.distance, big(1.7)), fullDistance)) {
				the_ring.the_ring.visible = false;
			}
			else {
				the_ring.the_ring.visible = true;
			}
			
			
			if (the_ring.stats.num < closestRing.num) {
				the_ring.removeEventListener('tick', ring_set);
				stage.removeChild(the_ring);
			}
			
		}
		
		
		
		
		function move_particle(e) {
			var particle = e.currentTarget;
			particle.frame.gotoAndStop(particle.color);
			if (particle.frame.currentFrame == particle.color) {
			}
			else {
				particle.frame.gotoAndStop(particle.color);
			}
			
			
			if (!stop && closestRing != NULL) {
				particle.movFullX = divide(multiply(big(particle.movX), particle.speed),big(fps / gameSpeed));
				particle.movFullY = divide(multiply(big(particle.movY), particle.speed),big(fps / gameSpeed));
				particle.posmaxX = plus(particle.posX, particle.movFullX);
				particle.posmaxY = plus(particle.posY, particle.movFullY);
				particle.tDistance = pow_func(plus(multiply(particle.posmaxX, particle.posmaxX), multiply(particle.posmaxY, particle.posmaxY)), 0.5);
				particle.tDistance = divide(plus(particle.tDistance, multiply(particle.tDistance, big(Math.pow(particle.friction , 1/fps * gameSpeed)))), big(2));
				particle.tDistance = multiply(particle.tDistance, big(Math.pow(particle.drag , 1/fps * gameSpeed)));
				
				
				var spChance = Math.random();
				if (spChance <= 1 - Math.pow((1-spl_ch), 1/fps*gameSpeed)) {
					if (particles.length < options.maxParticles) {
						split(particle);
					}
				}
				
				var dIncCH = Math.random();
				if (dIncCH <= 1 - Math.pow((1-dmgICh), 1/fps*gameSpeed)) {
					particle.DMGPerym = multiply(particle.DMGPerym, plus(big(1), dmgInc));
					particle.DMGBase = multiply(particle.DMGBase, plus(big(1), dmgInc));
				}
				
				
				
				particle.size = multiply(particle.size, pow_func(big(sizeGrow), 1/fps*gameSpeed));
				particle.size = b_min(particle.size, divide(fullDistance, big(5)));
				
				
				if (bigger(particle.tDistance, minus(closestRing.distance, multiply(particle.size,big(0.5))))) {
					particle.posX = multiply(big(particle.movX), minus(closestRing.distance, multiply(particle.size,big(0.5))));
					particle.posX_est = minus(particle.posmaxX, particle.posX);
					particle.posY = multiply(big(particle.movY), minus(closestRing.distance, multiply(particle.size,big(0.5))));
					particle.posY_est = minus(particle.posmaxY, particle.posY);
					
					particle.tDistance = pow_func(plus(multiply(particle.posX_est, particle.posX_est), multiply(particle.posY_est, particle.posY_est)), 0.5);
					particle.tDistance = divide(plus(particle.tDistance, multiply(particle.tDistance, big(Math.pow(particle.friction , 1/fps*gameSpeed)))), big(2));
					particle.tDistance = multiply(particle.tDistance, big(Math.pow(particle.drag , 1/fps*gameSpeed)));
					particle.tDistance = multiply(particle.tDistance, big(1 - wall_t));
					particle.laps = b_logof((plus(multiply(divide(particle.tDistance, multiply(closestRing.distance, big(2))), big(1/(1 - 0.5) - 1)), big(1))), big(1/(1 - 0.5)));
					particle.lap_est = particle.laps - Math.floor(particle.laps);
					particle.laps = Math.floor(particle.laps) + 1;
					particle.distEst = multiply(closestRing.distance, big(particle.lap_est));
					if (lower(particle.size , divide(closestRing.distance, big(20))) && particle.laps >= 3 && particles.length >= 20) {	
						particle.visible = false;
					}
					else {
						particle.visible = true;
					}
					particle.posX_est = multiply(big(particle.movX), particle.distEst);
					particle.posY_est = multiply(big(particle.movY), particle.distEst);
					
					particle.speed = multiply(particle.speed, big(1 - wall_t));
					
					particle.damage = multiply(particle.damage, big(particle.laps));
					
					var rNum = Math.random();
					if (rNum < crit_chance) {
						particle.crit = true;
						particle.damage = multiply(particle.damage,big(crit_power));
					}
					else {
						particle.crit = false;
					}
					
					closestRing.hpnow = minus(closestRing.hpnow, particle.damage);
					thisWallPow = plus(thisWallPow, multiply(bounceIncr, big(particle.laps)));
					
					var cdX = CENTERX + getVal(divide(particle.posX, fullDistance)) * FIELDSIZE * 1.15;
					var cdY = CENTERY + getVal(divide(particle.posY, fullDistance)) * FIELDSIZE * 1.15;
					if (cdX > 430) cdX = 430;
					if (cdX < 30) cdX = 30;
					if (cdY > 475) cdY = 475;
					if (cdY < 75) cdY = 75;
					
					
					if (particle.crit == true) {
						if (splashes <= 100) {
							createDMGCrit(particle.damage, cdX, cdY, particle.movX, particle.movY, particle.laps);
						}
					}
					else {
						if (splashes <= 100) {
							createDMG(particle.damage, cdX, cdY, particle.movX, particle.movY, particle.laps);
						}
					}
					if (lower(closestRing.hpnow, big(0))) {
						destroyClosest();
						var OV = Math.random();
						if (OV < ovkCh) {
							particle.limit = false;
							particle.DMGPerym = multiply(particle.DMGBase , plus(big(1), ovkD));
						}
						else {
							particle.limit = true;
						}
					}
					else {
						particle.limit = true;
					}
				}
				else {
					particle.posX = particle.posmaxX;
					particle.posY = particle.posmaxY;
					particle.limit = false;
					particle.visible = true;
				}
		
				wayPts = plus(wayPts, multiply(multiply(divide(particle.speed, new BigNum(fps / gameSpeed,0)), multiply(b19mult, gainMult)), bpWpG));
				allTimeWP = plus(allTimeWP, multiply(multiply(divide(particle.speed, new BigNum(fps / gameSpeed,0)), multiply(b19mult, gainMult)), bpWpG));
				particle.x = CENTERX + getVal(divide(particle.posX, fullDistance)) * FIELDSIZE;
				particle.y = CENTERY + getVal(divide(particle.posY, fullDistance)) * FIELDSIZE;
				particle.rotation += particle.rotator / fps * gameSpeed * getVal(divide(particle.speed, particle.maxSpeed));
				
				fullDistance = multiply(b_max(divide(fullDistance, new BigNum(2,0)), multiply(plus(b_abs(particle.posX),divide(particle.size, new BigNum(2, 0))), new BigNum(1.33, 0))), new BigNum(2,0));
				fullDistance = multiply(b_max(divide(fullDistance, new BigNum(2,0)), multiply(plus(b_abs(particle.posY),divide(particle.size, new BigNum(2, 0))), new BigNum(1.33, 0))), new BigNum(2,0));
				
				particle.scaleSize = b_max(multiply(divide(big(FULLSCALE), fullDistance), particle.size), big(0.035));
				particle.scaleX = Math.min(FULLSCALE/5, getVal(particle.scaleSize));
				particle.scaleY = Math.min(FULLSCALE/5, getVal(particle.scaleSize));
				
				
				particle.speed = multiply(particle.speed , big(Math.pow(particle.friction , 1/fps * gameSpeed)));
				particle.speed = multiply(particle.speed , big(Math.pow(particle.drag , 1/fps * gameSpeed)));
				particle.speed = plus(particle.speed, divide(particle.acceleration, big(fps / gameSpeed)));
				particle.acceleration = plus(particle.acceleration, divide(particle.a_derivative, big(fps / gameSpeed)));
				particle.damage = multiply(particle.DMGPerym, particle.speed);
				
				
				particle.distance = pow_func(plus(multiply(particle.posX,particle.posX),multiply(particle.posY,particle.posY)), 0.5);
				
				
				while (particle.limit == true) {
					particle.movX *= -1;
					particle.movY *= -1;
					particle.movFullX = multiply(particle.posX_est, big(-1));
					particle.movFullY = multiply(particle.posY_est, big(-1));
					particle.posmaxX = plus(particle.posX, particle.movFullX);
					particle.posmaxY = plus(particle.posY, particle.movFullY);
					particle.tDistance = pow_func(plus(multiply(particle.posmaxX, particle.posmaxX), multiply(particle.posmaxY, particle.posmaxY)), 0.5);
				
					if (bigger(particle.tDistance, minus(closestRing.distance, multiply(particle.size,big(0.5))))) {
						particle.posX = multiply(big(particle.movX), minus(closestRing.distance, multiply(particle.size,big(0.5))));
						particle.posX_est = minus(particle.posmaxX, particle.posX);
						particle.posY = multiply(big(particle.movY), minus(closestRing.distance, multiply(particle.size,big(0.5))));
						particle.posY_est = minus(particle.posmaxY, particle.posY);
						
						var rNum = Math.random();
						if (rNum < crit_chance) {
							particle.crit = true;
							particle.damage = multiply(particle.damage,big(crit_power));
						}
						else {
							particle.crit = false;
						}
						
						
						closestRing.hpnow = minus(closestRing.hpnow, particle.damage);
						thisWallPow = plus(thisWallPow, bounceIncr);
						
						var cdX = CENTERX + getVal(divide(particle.posX, fullDistance)) * FIELDSIZE * 1.15;
						var cdY = CENTERY + getVal(divide(particle.posY, fullDistance)) * FIELDSIZE * 1.15;
						
						if (particle.crit == true) {
							if (splashes <= 100) {
								createDMGCrit(particle.damage, cdX, cdY);
							}
						}
						else {
							if (splashes <= 100) {
								createDMG(particle.damage, cdX, cdY);
							}
						}
						
						if (lower(closestRing.hpnow, big(0))) {
							destroyClosest();
						}
						particle.limit = true;
					}
					else {
						particle.posX = particle.posmaxX;
						particle.posY = particle.posmaxY;
						particle.limit = false;
					}
					particle.distance = pow_func(plus(multiply(particle.posX,particle.posX),multiply(particle.posY,particle.posY)), 0.5);
				}
				
				
				if (bigger(particle.speed, particle.maxSpeed)) {
					particle.maxSpeed = particle.speed;
				}
				
				if (particle.lifeEst > 0) {
					particle.lifeEst -= 1/fps * gameSpeed;
				}
				else if (particle.exists) {
					killParticle(particles, particle.number);
				}
				
				particle.alpha = Math.min(1, Math.sqrt(particle.lifeEst*2));
				
				if (hover(particle)) {
					currentTarget = particle;
				}
				
				if (currentTarget == particle) {
					particle.hoverage.visible = true;
				}
				else {
					particle.hoverage.visible = false;
				}
				
				if (currentTarget == NULL && particle.lifeEst > 0) {
					currentTarget = particle;
				}
			
			}
			
			
		}
		
		
		
		
		
		function split(ThisParticle) {
			for (var i = 0 ; i < 2 ; ++i) {
				var particle = new lib.particle();
				particle.visible = false;
				stage.addChild(particle);
				particle.x = ThisParticle.x;
				particle.y = ThisParticle.y;
				particle.color = ThisParticle.color;
				particle.frame.gotoAndStop(particle.color);
				particle.posX = ThisParticle.posX;
				particle.posY = ThisParticle.posY;
				particle.movX = Math.pow(-1,i) + ThisParticle.movX;
				particle.movY = Math.pow(-1,i) +  ThisParticle.movY;
				var normator = Math.sqrt(particle.movX*particle.movX + particle.movY*particle.movY);
				particle.movX /= normator;
				particle.movY /= normator;
				particle.rSpeed = ThisParticle.rSpeed;
				particle.speed = multiply(ThisParticle.speed, big(2));
				particle.maxSpeed = particle.speed;
				particle.friction = friction; // per second
				particle.drag = drag; // per second
				particle.acceleration = ThisParticle.acceleration;
				particle.a_derivative = ThisParticle.a_derivative;
				particle.number = particles.length;
				
				particle.baseSpeed = particle.speed;
				particle.baseAcceleration = particle.acceleration;
				particle.baseA_derivative = particle.a_derivative;
				
				particle.reb = rebirth;
		
				
				particle.size = divide(ThisParticle.size, big(2));
				
				
				particle.sizeMult = pow_func(particle.size, dimensionality); //in meters
				particle.rotator = (-1 + Math.random()*2)*1000;
				
				particle.DMGPerym = ThisParticle.DMGPerym;
				particle.DMGBase = ThisParticle.DMGBase;
				particle.damage = ThisParticle.damage;
				
				particle.critChance = crit_chance;
				particle.critPower = crit_power;
				particle.lifeSpan = lifespan;
				particle.lifeEst = (lifespan + ThisParticle.lifeEst*9)/10;
				particle.limit = false;
				particle.exists = true;
				
				particle.scaleSize = b_max(multiply(divide(new BigNum(FULLSCALE, 0), fullDistance), particle.size), new BigNum(0.035,0));
				particle.scaleX = Math.min(FULLSCALE/5, getVal(particle.scaleSize));
				particle.scaleY = Math.min(FULLSCALE/5, getVal(particle.scaleSize));
				
				particle.hoverage.visible = false;
				particle.distance = ThisParticle.distance;
				
				
				if (currentTarget == ThisParticle) {
					currentTarget = particle;
				}
				
				current++;
				
				particle.addEventListener('tick', move_particle);
				particles.push(particle);
			}
			killParticle(particles, ThisParticle.number);
		}
		
		
		
		
		function merge(P1, P2) {
			var particle = new lib.particle();
				particle.visible = false;
				stage.addChild(particle);
				particle.x = P1.x;
				particle.y = P1.y;
				particle.color = Math.round((P1.color + P2.color)/2);
				particle.frame.gotoAndStop(particle.color);
				particle.posX = P1.posX;
				particle.posY = P1.posY;
				particle.movX = P1.movX;
				particle.movY = P1.movY;
				var normator = Math.sqrt(P1.movX*P1.movX + P1.movY*P1.movY);
				particle.movX /= normator;
				particle.movY /= normator;
				particle.rSpeed = P1.rSpeed;
				particle.speed = multiply(b_max(P1.speed, P2.speed), mergeS);
				particle.maxSpeed = particle.speed;
				particle.friction = friction; // per second
				particle.drag = drag; // per second
				particle.acceleration = multiply(b_max(P1.acceleration, P2.acceleration), mergeS);
				particle.a_derivative = multiply(b_max(P1.a_derivative, P2.a_derivative), mergeS);
				particle.number = particles.length;
				
				particle.reb = rebirth;
		
				
				particle.size = plus(P1.size, P2.size);
				
				
				particle.sizeMult = pow_func(particle.size, dimensionality); //in meters
				particle.rotator = (-1 + Math.random()*2)*1000;
				
				particle.DMGPerym = multiply(b_max(P1.DMGPerym, P2.DMGPerym), mergeD);
				particle.DMGBase = multiply(b_max(P1.DMGBase, P2.DMGBase), mergeD);
				particle.damage = multiply(b_max(P1.damage, P2.damage), mergeD);
				
				particle.critChance = crit_chance;
				particle.critPower = crit_power;
				particle.lifeSpan = lifespan;
				particle.lifeEst = Math.min(P1.lifeEst,P2.lifeEst);
				particle.limit = false;
				particle.exists = true;
				
				particle.scaleSize = b_max(multiply(divide(new BigNum(FULLSCALE, 0), fullDistance), particle.size), new BigNum(0.035,0));
				particle.scaleX = Math.min(FULLSCALE/5, getVal(particle.scaleSize));
				particle.scaleY = Math.min(FULLSCALE/5, getVal(particle.scaleSize));
				
				particle.hoverage.visible = false;
				particle.distance = P1.distance;
				
				
				particle.baseSpeed = particle.speed;
				particle.baseAcceleration = particle.acceleration;
				particle.baseA_derivative = particle.a_derivative;
				
				
				if (currentTarget == P1 || currentTarget == P2) {
					currentTarget = particle;
				}
				
				current++;
				
				particle.visible = true;
				particle.addEventListener('tick', move_particle);
				particles.push(particle);
				
				
				killParticle(particles, P1.number);
				killParticle(particles, P2.number);
		}
		
		
		
		
		
		
		
