		function encode(text) {
			var newText = "";
			var newText2 = "";
			for (var i = 0; i < text.length ; ++i) {
				newText += codeF(text[i]);
			}
			for (var i = 0 ; i < newText.length ; ++i) {
				newText2 += deorder(newText[i]);
			}
			return newText2;
		}
		
		
		
		function decode(text) {
			var newText = "";
			var oldText = "";
			for (var i = 0 ; i < text.length ; ++i) {
				oldText += deorder(text[i]);
			}
			for (var i = 0; i < oldText.length-1 ; i+=2) {
				var tPart = "";
				tPart += oldText[i];
				tPart += oldText[i+1];
				newText += codeR(tPart);
			}
			return newText;
		}
		
		
		
